import './custombutton.scss'
import { withRouter } from 'react-router-dom'

const CustomButton = ({name, buttonUrlLink}) => {
    return (
        <div class='custom-button' onClick={buttonUrlLink}>{name}</div>
    )
}

export default CustomButton
